import React from "react";
import { Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import Home from "./pages/Home";
import Login from "./pages/Login";
import Register from "./pages/Register";
import About from "./pages/About";
import Contact from "./pages/Contact";
import ProductDetails from "./pages/ProductDetails";
import CartPage from "./pages/CartPage"; // ✅ Import CartPage
import { CartProvider } from "./context/CartContext"; // ✅ Wrap with CartProvider
import AdminSignup from "./pages/AdminSignup"; // ✅ Import the page

function App() {
  return (
    <CartProvider>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/product/:id" element={<ProductDetails />} />
        <Route path="/cart" element={<CartPage />} /> {/* ✅ Cart Page */}
        <Route path="/admin-signup" element={<AdminSignup />} /> {/* ✅ Add Route */}
      </Routes>
    </CartProvider>
  );
}

export default App;
